import styled from "styled-components";

const Cartita = styled.div `
    background-color: white;
    border-radius: 3em;
    border-style: solid;
    border-width: 2px;
    border-color: black;
    font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;

`
export const Detail = () => {
  return (
    <Cartita>Detail</Cartita>
  )
}

export default Detail;
